import React, { Component } from 'react';
import './Login.css'
import App from './App';


class Login extends Component {
  constructor(props) {
    super(props);
    this.state = {
      loggedIn:false
    };
  }

  render() {
    return (
    <>
    <div id="loginBox">
        <h1>Login</h1>
        <input></input>
    </div>
    {this.state.loggedIn && (
          <App />
        )}
    </>
    );
  }
}

export default Login;
